import { Link } from 'react-router-dom';

export default function Navbar() {
  const user = JSON.parse(localStorage.getItem('user'));

  return (
    <nav className="flex justify-between items-center px-8 py-4 bg-gray-900 text-white">
      <h2 className="text-2xl font-bold">ðŸŽ¨ Artify</h2>
      <div className="flex gap-4">
        <Link to="/" className="hover:underline">Home</Link>
        <Link to="/upload" className="hover:underline">Upload</Link>
        <Link to="/login" className="hover:underline">Login</Link>
        <Link to="/signup" className="hover:underline">Signup</Link>
        <Link to="/cart" className="px-3 py-1 bg-blue-500 text-white rounded hover:bg-blue-600">Cart</Link>
        <Link to="/my-orders" className="hover:underline">My Orders</Link>
        {user?.role === 'artist' && (
          <Link to="/artist-dashboard" className="hover:underline">Dashboard</Link>
        )}
      </div>
    </nav>
  );
}
